import Logo from '../../assets/logo.jpeg';
import React, { useState, useEffect } from 'react';
import { Menu, X, Home, User, Briefcase, Mail, FileText, Github, Linkedin, Twitter } from 'lucide-react';
import data from './data';
import './navbar.css'

const Navbar = () => {

    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const [isScrolled, setIsScrolled] = useState(false);

    // Handle scroll effect
    useEffect(() => {
        const handleScroll = () => {
            setIsScrolled(window.scrollY > 50);
        };

        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    // Close menu when clicking outside
    useEffect(() => {
        const handleClickOutside = (event) => {
            if (isMenuOpen && !event.target.closest('.navbar') && !event.target.closest('.mobile-menu')) {
                setIsMenuOpen(false);
            }
        };

        document.addEventListener('click', handleClickOutside);
        return () => document.removeEventListener('click', handleClickOutside);
    }, [isMenuOpen]);

    // Prevent body scroll when menu is open
    useEffect(() => {
        if (isMenuOpen) {
            document.body.style.overflow = 'hidden';
        } else {
            document.body.style.overflow = 'unset';
        }

        return () => {
            document.body.style.overflow = 'unset';
        };
    }, [isMenuOpen]);

    // Close menu on escape key
    useEffect(() => {
        const handleEscape = (event) => {
            if (event.key === 'Escape' && isMenuOpen) {
                setIsMenuOpen(false);
            }
        };

        document.addEventListener('keydown', handleEscape);
        return () => document.removeEventListener('keydown', handleEscape);
    }, [isMenuOpen]);

    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
    };

    const closeMenu = () => {
        setIsMenuOpen(false);
    };

    const socialLinks = [
        { icon: Github, href: 'https://github.com', label: 'GitHub' },
        { icon: Linkedin, href: 'https://linkedin.com', label: 'LinkedIn' },
        { icon: Twitter, href: 'https://twitter.com', label: 'Twitter' },
        { icon: Mail, href: 'mailto:hello@yourname.com', label: 'Email' }
    ];

    return (
        <>
            <nav>
                <div className="container nav_container">
                    <a href="index.html" className='nav_logo'>
                        <img src={Logo} alt="logo" />
                    </a>

                    <ul className='nav_menu'>
                        {
                            data.map(item => <li key={item.id}><a href={item.link}>{item.title}</a></li>)
                        }
                    </ul>
                    <button
                        className={`hamburger-btn ${isMenuOpen ? 'active' : ''}`}
                        onClick={toggleMenu}
                        aria-label="Toggle navigation menu"
                        aria-expanded={isMenuOpen}
                    >
                        <span className="hamburger-line"></span>
                        <span className="hamburger-line"></span>
                        <span className="hamburger-line"></span>
                    </button>
                </div>
            </nav>

            <div className={`mobile-menu-overlay ${isMenuOpen ? 'active' : ''}`} onClick={closeMenu}>
                <div className="mobile-menu" onClick={(e) => e.stopPropagation()}>

                    <div className="mobile-menu-header">
                        <div className="mobile-logo">
                            <span className="mobile-logo-text">YourName</span>
                        </div>
                        <button
                            className="close-btn"
                            onClick={closeMenu}
                            aria-label="Close navigation menu"
                        >
                            <X size={24} />
                        </button>
                    </div>

                    <div className="mobile-nav">
                        <div className="nav-section">
                            <h3 className="nav-section-title">Navigation</h3>
                            {navItems.map((item, index) => (
                                <a
                                    key={index}
                                    href={item.href}
                                    className="mobile-nav-link"
                                    onClick={closeMenu}
                                    style={{ '--delay': `${index * 0.1}s` }}
                                >
                                    <item.icon className="nav-icon" size={20} />
                                    <span className="nav-text">{item.name}</span>
                                    <div className="nav-arrow">→</div>
                                </a>
                            ))}
                        </div>

                        <div className="nav-section">
                            <h3 className="nav-section-title">Quick Actions</h3>
                            <a
                                href="mailto:hello@yourname.com"
                                className="mobile-nav-link action-link"
                                onClick={closeMenu}
                                style={{ '--delay': '0.5s' }}
                            >
                                <Mail className="nav-icon" size={20} />
                                <span className="nav-text">Send Email</span>
                                <div className="nav-arrow">→</div>
                            </a>
                            <a
                                href="#resume"
                                className="mobile-nav-link action-link"
                                onClick={closeMenu}
                                style={{ '--delay': '0.6s' }}
                            >
                                <FileText className="nav-icon" size={20} />
                                <span className="nav-text">Download Resume</span>
                                <div className="nav-arrow">→</div>
                            </a>
                        </div>
                    </div>

                    <div className="mobile-footer">
                        <div className="mobile-footer-content">
                            <p className="mobile-footer-text">Let's create something amazing together</p>
                            <div className="mobile-social">
                                {socialLinks.map((social, index) => (
                                    <a
                                        key={index}
                                        href={social.href}
                                        className="mobile-social-link"
                                        aria-label={social.label}
                                        style={{ '--delay': `${index * 0.1}s` }}
                                    >
                                        <social.icon size={18} />
                                    </a>
                                ))}
                            </div>
                            <div className="mobile-contact-info">
                                <p>hello@yourname.com</p>
                                <p>Available for freelance work</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default Navbar
